interface IProps {
  title: string
}

export function TableHeaderTitle({ title }: IProps) {
  return (
    <th className={`p-6 ${title === 'ID' ? 'w-1/5' : 'w-2/5'}`} scope="col">
      {title}
    </th>
  );
}
